import React, { Component } from 'react'
import "./myStyle.css";

class Binary extends Component {
    render() {
        const ar=[3,5,6,8,9,10];
        const ui=ar.map((x,index)=>
            <div key={index} className="q">{x}</div>
        );
        return (
            <center>
            <div className="mystl">
                {ui}
            </div>
            </center>
        )
    }
}

export default Binary
